  PRIMARY KEY (`id`),
  KEY `parent_id` (`parent_id`) USING BTREE,
  KEY `type_id` (`type_id`) USING BTREE,
  KEY `del_flag` (`del_flag`) USING BTREE,
  KEY `dict_type` (`dict_type`) USING BTREE
