-- ----------------------------
-- Table structure for platform_channel
-- ----------------------------
DROP TABLE IF EXISTS `platform_channel`;
CREATE TABLE `platform_channel` (
  `channel_name` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '渠道名称',
  `id` tinyblob COMMENT '渠道ID',
  `strategy_bean_id` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '策略执行beanid',
  `status` int(1) DEFAULT '0' COMMENT '状态 0 未启用 1：启用',
  `is_delete` int(1) DEFAULT '0' COMMENT '删除状态 0：未删除  1：已删除',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `channel_key` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '渠道key',
  `app_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '商户APPID',
  `app_privte_key` text COLLATE utf8mb4_unicode_ci COMMENT 'app私钥',
  `commercial_public_key` text COLLATE utf8mb4_unicode_ci COMMENT '商户公钥',
  `gateway` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '网关地址',
  `notify_url` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '异步通知地址',
  `syn_url` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '同步通知地址',
  `mchId` text COLLATE utf8mb4_unicode_ci COMMENT '商户号',
  `type` int(1) DEFAULT NULL COMMENT '类型 1  ：支付  2 短信',
  `tenant_id` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='平台渠道表';

-- ----------------------------
-- Records of platform_channel
-- ----------------------------

-- ----------------------------
-- Table structure for undo_log
-- ----------------------------
DROP TABLE IF EXISTS `undo_log`;
CREATE TABLE `undo_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'increment id',
  `branch_id` bigint(20) NOT NULL COMMENT 'branch transaction id',
  `xid` varchar(100) NOT NULL COMMENT 'global transaction id',
  `context` varchar(128) NOT NULL COMMENT 'undo_log context,such as serialization',
  `rollback_info` longblob NOT NULL COMMENT 'rollback info',
  `log_status` int(11) NOT NULL COMMENT '0:normal status,1:defense status',
  `log_created` datetime NOT NULL COMMENT 'create datetime',
  `log_modified` datetime NOT NULL COMMENT 'modify datetime',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ux_undo_log` (`xid`,`branch_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='AT transaction mode undo table';

-- ----------------------------
-- Records of undo_log
-- ----------------------------
