INSERT INTO `base_drive_flow` VALUES ('1216562926815543300', '科目四报名与考试', '     <div class=\"section align-left pd-tb-8\">         <div class=\"pd-tb-2 text-indent\">学员通过科目二及科目三的考试后，可根据自己时间安排，在平台上完成科目四考试的预约，由平台客服人员完成报名操作。实际操作及服务流程与科目一相同。</div>       </div>', '2020-01-13 11:27:48', '2020-01-13 15:47:35', '1', '1', '1210486874246746000', '7', '小郭', '530100', 'bbdc1bd499b241daa6fe99063e63a193');
INSERT INTO `base_drive_flow` VALUES ('1216565411240214500', '价格说明', ' <div class=\"section align-left pd-tb-8\">         <div class=\"pd-tb-10 fw-bold fs-16\"> 本平台价格主要由五大项目组成</div>         <div class=\"pd-tb-2\">1.报名备案、体检费</div>         <div class=\"pd-tb-2\">2.科目二课时训练费</div>         <div class=\"pd-tb-2\">3.科目三课时训练费</div>         <div class=\"pd-tb-2\">4.科目二、科目三考点模拟训练费</div>         <div class=\"pd-tb-2\">5.科目一、科目二、科目三报名考试费</div>       </div>', '2020-01-13 11:37:40', '2020-01-13 16:16:03', '0', '1', '1210486812418510800', '1', '小郭', '530100', 'bbdc1bd499b241daa6fe99063e63a193');
INSERT INTO `base_drive_flow` VALUES ('1216635672861933568', '价格总计', '<div class=\"section align-left pd-tb-8\">         <div class=\"pd-tb-10 fw-bold fs-16\">各费用详情</div>         <div class=\"pd-tb-2\">1.报名体检费   380元/人</div>         <div class=\"pd-tb-2\">2.科二学时费   900元/人(平均)</div>         <div class=\"pd-tb-2\">3.科三学时费   990元/人（平均）</div>         <div class=\"pd-tb-2\">4.科目报名考试费   570元/人</div>         <div class=\"pd-tb-2\">5.考试场地模拟训练费 科二、科三   560元/人</div>       </div>       <div class=\"section align-left pd-tb-8\">         <div class=\"pd-tb-10 fw-bold fs-16\">总计：</div>         <div class=\"pd-tb-4\">3400元/人(平均)</div>        </div>', '2020-01-13 16:16:52', null, '0', '1', '1210486812418510800', '2', '小纲', '530100', 'bbdc1bd499b241daa6fe99063e63a193');
INSERT INTO `base_drive_flow` VALUES ('1216635782597509120', '报名体检费', '<div class=\"section align-left pd-tb-8\">         <div class=\"pd-tb-10 fw-bold fs-16\">报名体检费</div>         <div class=\"pd-tb-3\">&nbsp;380元/人&nbsp;</div>         <div class=\"pd-tb-2\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;报名体检费，用于学员资料备案、体检、后期考试报名及运维服务。提交报名后平台分配专属客服全程服务。</div>       </div>', '2020-01-13 16:17:18', null, '0', '1', '1210486812418510800', '3', '小纲', '530100', 'bbdc1bd499b241daa6fe99063e63a193');
INSERT INTO `base_drive_flow` VALUES ('1216635901711548416', '科二学时费', '<div class=\"section align-left pd-tb-8\">         <div class=\"pd-tb-10 fw-bold fs-16\">科二学时费</div>         <div class=\"pd-tb-3\">&nbsp;900元/人&nbsp;</div>         <div class=\"pd-tb-2\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;科二课时费为100元/小时。平台所有课时均为一对一教学，一般只需9个课时就可以学习完成所有科目内容。</div>       </div>', '2020-01-13 16:17:46', null, '0', '1', '1210486812418510800', '4', '小纲', '530100', 'bbdc1bd499b241daa6fe99063e63a193');
INSERT INTO `base_drive_flow` VALUES ('1216636060872802304', '科三学时费', '<div class=\"section align-left pd-tb-8\">         <div class=\"pd-tb-10 fw-bold fs-16\">科三学时费</div>         <div class=\"pd-tb-3\">&nbsp;990元/人&nbsp;</div>         <div class=\"pd-tb-2\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;科目三学时费为110元/小时，平台所有课时均为一对一教学，一般只需9个课时就可学习完成所有科目内容。</div>       </div>', '2020-01-13 16:18:24', null, '0', '1', '1210486812418510800', '5', '小纲', '530100', 'bbdc1bd499b241daa6fe99063e63a193');
INSERT INTO `base_drive_flow` VALUES ('1216636269002555392', '报名考试费', '<div class=\"section align-left pd-tb-8\">         <div class=\"pd-tb-10 fw-bold fs-16\">报名考试费</div>         <div class=\"pd-tb-3\">&nbsp;570元/人&nbsp;</div>         <div class=\"pd-tb-2\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;科目报名考试费为交警部门统一收取，收费分别为：<br>科目一：60元<br>科目二：240元<br>科目三：270元<br>科目四：0元<br>合&nbsp;&nbsp;&nbsp;&nbsp;计：570元</div>       </div>', '2020-01-13 16:19:14', null, '0', '1', '1210486812418510800', '6', '小纲', '530100', 'bbdc1bd499b241daa6fe99063e63a193');
INSERT INTO `base_drive_flow` VALUES ('1216636375458185216', '考试场地模拟训练费', '<div class=\"section align-left pd-tb-8\">         <div class=\"pd-tb-10 fw-bold fs-16\">考试场地模拟训练费</div>         <div class=\"pd-tb-3\">&nbsp;560元/人&nbsp;</div>         <div class=\"pd-tb-2\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;考试场地模拟训练费是学员在考试前提前到场地熟悉考试环境，提前模拟考试情景，这一环节可根据自身情况选择，平台建议一般还是提前熟悉方便考试。<br><br>           <div class=\"fee-spe\">              <div class=\"font\">考试场地训练费/小时<br>180</div><div>+</div><div class=\"font\">教练课时费<br>100</div><div>=</div><div class=\"font\">科目二的模拟考试费<br>280</div>           </div>           <div class=\"fee-spe\">             <div class=\"font\">考试场地训练费/小时<br>160</div><div>+</div><div class=\"font\">教练课时费<br>120</div><div>=</div><div class=\"font\">科目三的模拟考试费<br>280</div>           </div>         </div>       </div>', '2020-01-13 16:19:39', null, '0', '1', '1210486812418510800', '7', '小纲', '530100', 'bbdc1bd499b241daa6fe99063e63a193');
