INSERT INTO `base_driving_video` VALUES ('1286199931901140994', '0', '科目二侧方位停车技巧', '侧方位停车', '原因1：起步时，离合器松的太快，油门没有跟上。原因2：半联动起步时，达到半联动的点时，却没有松开手刹即会造成车辆熄火。以上所列举的是一些比较典型，遇见的比较多的情况，如果您的熄火并不属于以上这两种，那么可以跳到文末，本文将给各位提供一种，使用简单、上手快的万能上坡起步法。上坡起步熄火的解决办法既然咱们已经分析出了上坡起步容易造成熄火的两个原因，那么咱们就针对以上这两点来针对性的对上坡起步进行修正即可。其实说白了，想要上坡起步做的好，就得多练习半联动的使用。或者使用下面介绍的“万能上坡起步法”。万能上坡起步法如果使用半联动来完成上坡起步的话，学员必须把油门、离合、刹车配合好才行，这些对于只“摸”了几天车的学员来说有一定的难度。', 'http://static.xuechexwz.com/pro/images/km1-images/cefangwei.jpg', 'http://video.xuechexwz.com/asset/4975194b244b384eb85632032882d781/play_video/64f4a3dbe3f6f2fefd6ec36041c963b2.m3u8', '/', 'https://www.jiakaobaodian.com/news/detail/553111.html', null, '100', 'md5', 'sha', '2', '1', '1', '0', '2020-07-23 15:24:29', '2020-07-23 15:15:40', null, '科目二', '2');
INSERT INTO `base_driving_video` VALUES ('1286205741284794369', '0', '科目二直角转弯注意事项 ，你知道几个？', '直角转弯', '直角转弯是科目二五项必考之一。对于学员来说，直角转弯可能是科目二考试中最简单的一项考试了。但往往最简单的是最容易出错的，因此，就和大家分享科目二直角转弯的注意事项。1、进入弯道前车速一定要放慢，关键在于摆正车身。2、车身摆正时，车辆缓慢地靠近道路外侧边缘线行驶，并控制好横向间距，以外侧车轮与外侧边缘线保持约30cm以内的间距为宜，并保持平行前进。3、车头接近转弯点，急转方向莫迟延。待前保险杆与突起点平齐时，迅速向左(右)转动转向盘至极限位置。忌猛踩节气门踏板。4、先看前方能否过，缓缓前进要斟酌，对没有把握或把握不大的直角弯，可事先停车查看，在通过中，要沉着冷静，时刻注意车身的移动情况以及车轮的位置变化。如条件许，可在他人的指挥下缓慢通过。5、后视镜中后轮，打回方向要记清。待车头接近直角转弯拐点时，要及时回转方向盘；待车头转至新方向时，逐渐回正，使车辆正前进。同，也可以通过观察后视镜的方法，查看后轮的运动位置，即当后轮将要越过转弯拐点时，再回正方向盘。', 'http://static.xuechexwz.com/pro/images/km1-images/zhijiao.jpg', 'http://video.xuechexwz.com/asset/e438fe3e898d8c67c2929b9af417c07d/play_video/d6e04603557f5bb7692dcacd43e72087.m3u8', '/', 'https://www.jiakaobaodian.com/news/detail/553111.html', '1', '100', 'md5', 'sha1', '2', '2', '1', '0', '2020-07-23 15:45:31', '2020-07-23 15:38:45', null, '科目二', '2');
INSERT INTO `base_driving_video` VALUES ('1286208504098041857', '0', '科目三走直线太难？别急，看完这个就不用愁啦！', '科目三走直线太难？别急，看完这个就不用愁啦！', '有众多的学员在苦恼，科目三的直线行驶，别看就短短的距离，但是分分钟就开歪，那怎样克服这个问题呢？一起来看看~★ 1、方向盘要正★一般情况下，只要方向盘是正的情况下车行驶的路径就会是直的，所以在上这段路之前，一定要确认好自己的方向盘是正的。如果实在是不正，在感到车身歪了之后要微调方向盘，不要过分紧张手抖，开出S路。★ 2、寻找参照物★要想把车长时间的开直，要学会在路上找参照物，可以是路中间的标线，也可以是路边缘石，还可以是路边的植物。★ 3、视线放远★很多学员把车开歪有个很重要的原因是目光只顾及眼前，这样做是不对的，目光一定要放远，并把视野放大，这样做的话是更容易发现自己是否开偏，及时做好调整。★ 4、车感很重要★不管是倒车还是开直线，车感都是很重要的，要想车感好，只能在练车中多注意找感觉并且多练习，这样，等你有了车感后，开直线就没有问题啦~', 'http://static.xuechexwz.com/pro/images/km1-images/subject3.jpg?Tem=22323', '', null, 'https://www.jiakaobaodian.com/news/detail/1458326.html', '1', '100', 'md5', 'sha1', '2', '1', '1', '0', '2020-07-23 15:57:28', '2020-07-23 15:49:44', '2020-07-23 15:56:19', '科目三', '3');
