INSERT INTO `base_driving_video` VALUES ('1287121259690114094', '0', '曲线行驶', '曲线行驶', '<div class=\"content \">\r\n<div class=\"content \">\r\n<p>1、曲线行驶的操作技巧</p>\r\n<p>①保持全程一挡行驶，打方向不可过急。</p>\r\n<p>②进入弯道后尽量走大圈，驶向右弯道时，右轮紧贴着右边路边缘线，反之亦然。</p>\r\n<p>③处于弯道时，通过转向盘让汽车内侧车盖头上的小后视镜始终处于外侧白线边缘，既不出线，也不能离边缘线太远。</p>\r\n<p>④根据路弯的特点和后轮半径及时调整方向。</p>\r\n<p><img src=\"http://static.xuechexwz.com/pro/video/6.jpg\" data-width=\"489\" data-height=\"295\" data-type=\"image\" /></p>\r\n<p>2、曲线S路操作:</p>\r\n<p>入口有两种方向，左入口和右入口。左入口时，车辆尽量靠近右边线后，再左转方向盘;右入口时，相反，车辆尽量靠近左边线后，再右转方向盘。因为考虑到内轮差，避免在转弯时，后轮压线。</p>\r\n<p>行进过程中，车头压着边线走。左转弯时，车头压着右边线行进;右转弯时，车头压着左边线行进。</p>\r\n<p>出S路时，有两种方向，左出口和右出口。左出口时，当前轮刚好离开时，往右回半个圈方向，避免后轮压线;右出口时，相反，当前轮刚好离开时，往左回半个圈方向，避免后轮压线</p>\r\n</div>\r\n</div>', 'http://static.xuechexwz.com/pro/images/km1-images/quxian0.jpg', 'http://video.xuechexwz.com/asset/3dee8a01f7879ed02618e0ccc3a1869b/play_video/c2a728ff04780d1e4bbb299bebf47d1a.m3u8', '/', 'https://www.jiakaobaodian.com/news/detail/553111.html', null, '100', 'md5', 'sha', '2', '3', '1', '0', '2020-07-23 15:24:29', '2020-07-23 15:15:40', null, '科目二', '2');
INSERT INTO `base_driving_video` VALUES ('1421259342353450994', '0', '倒车入库', '倒车入库', '<div class=\"content \">\n<p>停车步骤：</p>\n<p>1.先将汽车驶过停车位，让驾驶员的位置刚好处于隔一个车位中间时</p>\n<p>（如果驾驶的车辆较大，则车辆还需往前移半个车位左右）。</p>\n<p>此时，车辆与旁边车位间的横向距离保持在1.5米左右。</p>\n<p>2.将方向盘向内侧打满方向，并缓慢往后倒车。</p>\n<p>3.当你确认车头正了时，马上回正方向盘，继续倒车至完全进入车位。</p>\n<p>4.拉手刹，熄火。</p>\n<p>5.停车完成。</p>\n<p><strong>&ldquo;非&rdquo;字形停车位：</strong></p>\n<p>1.将车停在停车线旁1.5米左右的位置。</p>\n<p>2.您所坐的位置，正好处于隔一个车位的中间。</p>\n<p>3.然后左打满，开始倒车。</p>\n<p>4.车正后回正方向，继续往后倒。</p>\n<p>5.入库后停车。</p>\n<p><strong>具体做法：</strong></p>\n<p>1.方向盘打死</p>\n<p>原因:因为，方向盘打的越大其助力压力就越高。如果，方向盘经常打死会造成助力泵长期处于高压状态，这样会加速了助力泵的损坏速度。</p>\n<p>正确做法:方向盘每次在打死后稍微回一点，不要硬顶着。</p>\n<p>2.原地打方向</p>\n<p>原因:因为，原地打方向不仅会增加助力泵的负荷还会加大轮胎的磨损程度，如果在砂石路上就更加严重了。</p>\n<p>正确做法:车动方向动，车停方向停。</p>\n<p>3.车没停稳就挂倒挡</p>\n<p>原因:因为，倒档没有同步器，车在没有停稳时，倒档齿轮也是在运动的。如果此时挂上倒档就必然会造成两个齿轮打架。</p>\n<p>正确做法：等车停稳了再挂入倒档!</p>\n<p>4.用手刹停车</p>\n<p>原因:因为经常使用手刹进行制动，手刹拉线会拉伸变形，刹车片越磨越薄，导致制动力越来越小，最后不得不去调整手刹拉线或更换蹄片。</p>\n<p>正确做法:汽车停稳后再拉手刹，切记</p>\n<p>5.不停在平地上</p>\n<p>原因:因为停在不平的地方，车辆的轮胎和悬挂都会受到不同的压力，久而久之老化程度也是不均匀的。</p>\n<p>正确做法:尽可能的选择平地上停车</p>\n<p>6.坡道P挡驻车</p>\n<p>原因:在坡道上停车时，如果只使用P挡驻车的话，锁止机构会承担一个非常大的力，严重时锁柱无法脱出，也就是变速箱卡在P挡无法切换其他挡位，只能找一辆车拽一下，再切换挡位，或者想办法抬起驱动轮再解锁。</p>\n<p>正确做法：尽量避免在坡道上停车，如果只能停在坡道上，恰好又是自动挡车型，请记住以下操作方法：停车&rarr;挂空挡&rarr;拉手刹&rarr;松刹车再踩刹车&rarr;挂P挡。这样就等于用手刹先固定好车辆再用P挡锁止。</p>\n</div>', 'http://static.xuechexwz.com/pro/images/km1-images/daoche.jpg', 'http://video.xuechexwz.com/asset/12eff2a528db3da064a960151be378a9/play_video/c5e28243e19d64fac1c655cf58073992.m3u8', '/', 'https://www.jiakaobaodian.com/news/detail/553111.html', null, '100', 'md5', 'sha', '2', '4', '1', '0', '2020-07-23 15:24:29', '2020-07-23 15:15:40', null, '科目二', '2');
INSERT INTO `base_driving_video` VALUES ('1421259693453450994', '0', '上坡起步和定点停车', '上坡起步和定点停车', '<p>原因1：起步时，离合器松的太快，油门没有跟上。</p>\r\n<p>原因2：半联动起步时，达到半联动的点时，却没有松开手刹即会造成车辆熄火。</p>\r\n<p>以上所列举的是一些比较典型，遇见的比较多的情况，如果您的熄火并不属于以上这两种，那么可以跳到文末，本文将给各位提供一种，使用简单、上手快的万能上坡起步法。</p>\r\n<p>上坡起步熄火的解决办法</p>\r\n<p>既然咱们已经分析出了上坡起步容易造成熄火的两个原因，那么咱们就针对以上这两点来针对性的对上坡起步进行修正即可。</p>\r\n<p><img src=\"http://static.xuechexwz.com/pro/video/4.jpg\" data-width=\"471\" data-height=\"298\" data-type=\"image\" /></p>\r\n<p>其实说白了，想要上坡起步做的好，就得多练习半联动的使用。或者使用下面介绍的&ldquo;万能上坡起步法&rdquo;。</p>\r\n<p>万能上坡起步法</p>\r\n<p>如果使用半联动来完成上坡起步的话，学员必须把油门、离合、刹车配合好才行，这些对于只&ldquo;摸&rdquo;了几天车的学员来说有一定的难度。</p>', 'http://static.xuechexwz.com/pro/images/km1-images/podao.jpg', 'http://video.xuechexwz.com/asset/b8b94543b3ca746899042059cf43681c/play_video/9caf663ba222a5e6761d40f29683ef97.m3u8', '/', 'https://www.jiakaobaodian.com/news/detail/553111.html', null, '100', 'md5', 'sha', '2', '5', '1', '0', '2020-07-23 15:24:29', '2020-07-23 15:15:40', null, '科目二', '2');
